document.addEventListener("DOMContentLoaded", () => {
    const reportData = JSON.parse(sessionStorage.getItem("reportData"));

    if (!reportData) {
        window.location.href = "createreport.html";
    }

    document.getElementById("reportPreview").innerHTML = `
        <p><strong>Driver's Name:</strong> ${reportData.driverName}</p>
        <p><strong>Vehicle Number:</strong> ${reportData.vehicleNumber}</p>
        <p><strong>Odometer Reading:</strong> ${reportData.odometerReading}</p>
        <p><strong>Driver's Signature:</strong> ${reportData.driverSignature}</p>
    `;

    document.getElementById("submitReport").addEventListener("click", () => {
        generatePDF(reportData);
    });
});

// PDF Generation
function generatePDF(reportData) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // Base64 logo string (replace with your actual Base64 string from the encoder)
    const logoImage = "data:image/png;base64,"; // Truncated for brevity

    // Add the logo to the PDF
    doc.addImage(logoImage, "PNG", 60, 10, 90, 50); // (image, type, x, y, width, height)

    // Add title
    doc.setFontSize(16);
    doc.text("Driver's Vehicle Inspection Report", 10, 70);

    // Add report details
    doc.setFontSize(12);
    doc.text(`Driver's Name: ${reportData.driverName}`, 10, 80);
    doc.text(`Vehicle Number: ${reportData.vehicleNumber}`, 10, 90);
    doc.text(`Odometer Reading: ${reportData.odometerReading}`, 10, 100);
    doc.text(`Driver's Signature: ${reportData.driverSignature}`, 10, 110);

    // Save the PDF
    doc.save("Inspection_Report.pdf");
}